import React from "react";

function ImageComponent() {
  const imageUrl = "https://www.canva.com/design/DAFlYujcSyc/9p47dVl2kv7g-HB633B4fw/edit?utm_content=DAFlYujcSyc&utm_campaign=designshare&utm_medium=link2&utm_source=sharebutton";

  return <img src={imageUrl} alt="Imagem" />;
}

export default ImageComponent;
